import React from 'react'
import TrackCard from '../components/TrackCard'

const FavoritesPage = ({favorites, setFavorites}) => {
  const handleFavorite = (track) => {
    setFavorites(favorites.filter(fav => fav.id !== track.id))
  }

  return (
    <div className="min-h-screen bg-gray-50 p-8">
      <div className="max-w-4xl mx-auto">
        <h1 className="text-4xl font-bold text-gray-800 mb-2">
           My Favorites
        </h1>
        <p className="text-gray-600 mb-8">
          Your saved songs ({favorites.length})
        </p>

        {favorites.length === 0 ? (
          <div className="text-center py-12">
            <div className="text-6xl mb-4"></div>
            <p className="text-xl text-gray-600">No favorites yet</p>
            <p className="text-gray-500">Start adding songs to your favorites!</p>
          </div>
        ) : (
          <div className="space-y-4">
            {favorites.map((track) => (
              <TrackCard
                key={track.id}
                track={track}
                onFavorite={handleFavorite}
                isFavorite={true}
              />
            ))}
          </div>
        )}
      </div>
    </div>
  )
}

export default FavoritesPage
